import {footer_menu} from "./data";
function Footer() {
    const uls = footer_menu.map(ul => {
        const lis = ul.list.map(item => {
            (<li className="footer-list__item" key={item}>
                <a className="footer-list__link"></a>{item}
            </li>)
        })
    })
    return (
        <footer className="footer">
            <ul className=""></ul>
        </footer>
    );
}
export default Footer;
